import React from "react";
import Breweries from "../breweries/Breweries";
import Search from "../breweries/Search";

const Home = props => {
  return (
    <div className="row">
      <div
        className="col-md-2 d-none d-md-block bg-light sidebar"
        style={{ borderRight: "1px solid rgba(0,0,0,.1)" }}
      >
        <nav className="collaspe bd-links" id="bd-docs-nav">
          <div className="bd-toc-item">
            <a href="#!" className="bd-toc-link">
              Getting Started
            </a>
          </div>
        </nav>
      </div>
      <main
        className="col-12 col-md-9 col-xl-8 py-md-3 pl-md-5 bd-content"
        role="main"
      >
        <Search />
        <Breweries />
      </main>
    </div>
  );
};

Home.propTypes = {};

export default Home;
